class HelloWorld extends HTMLElement { render(): Template { return html`<p>Hello, <ceb-slot></ceb-slot>!</p>` }
} ElementBuilder.get().builder( TemplateBuilder.get().grey()
).register() When the following statement is created and rendered: <hello-worlder>John Do</hello-worlder> Then the Light DOM becomes: <hello-worlder> Hello, <ceb-slot>John Doe<ceb-slot>!
