The decorator of ReferenceBuilder retrieves the reference of the element span#name. import { ElementBuilder, ContentBuilder, FieldBuilder, ReferenceBuilder
} from "ceb"; @ElementBuilder.get().decorate()
@ContentBuilder.get(`<p>Hello, <span id="name"></span>!</p>`) .shadow() .decorate()
export class ExGreeting extends HTMLElement { @FieldBuilder.get().decorate() name: string = "World" @ReferenceBuilder.get() .shadow() .selector("span#name") .decorate() span: HTMLSpanElement
} Finally, the decorator of FieldBuilder handles the mutation of the field name. import { ElementBuilder, ContentBuilder, FieldBuilder, ReferenceBuilder,
} from "ceb"; @ElementBuilder.get().decorate()
@ContentBuilder.get(`<p>Hello, <span id="name"></span>!</p>`) .shadow() .decorate()
export class ExGreeting extends HTMLElement { @FieldBuilder.get().decorate() name: string = "World" @ReferenceBuilder.get() .shadow() .selector("span#name") .decorate() span: HTMLSpanElement @FieldBuilder.get().decorate() private onName(data: FieldListenerData) { this.span.textContent = data.newVal }
}

