Alternatively, the decorator of AttributePropagationBuilder can be used to automatically binds the mutation of the field name to the property textContent of the selected element span#name : import { ElementBuilder, ContentBuilder, FieldBuilder, AttributePropagationBuilder
} from "ceb"; @ElementBuilder.get().decorate()
@ContentBuilder.get(`<p>Hello, <span id="name"></span>!</p>`) .shadow() .decorate()
@AttributePropagationBuilder.get("name") .shadow() .to("span#name") .property("textContent") .decorate()
export class ExGreeting extends HTMLElement { @FieldBuilder.get().decorate() name: string = "World"
}
